import { useState } from "react";
import LoginUser, { RegistrarUser } from "../api/Usuario.Route";

export default function TestAuth() {
  const [correo, setCorreo] = useState("kenny@example.com");
  const [contrasena, setContrasena] = useState("123456");

  const probarLogin = async () => {
    try {
      const res = await LoginUser({ correo, contrasena }); // o { correo, contraseña: contrasena }
      console.log("LOGIN OK =>", res.status, res.data);
      alert("Login OK (revisa consola)");
    } catch (err) {
      console.error("LOGIN ERR =>", err?.response?.data || err);
      alert(err?.response?.data?.message || "Error login");
    }
  };

  const probarRegistro = async () => {
    try {
      const res = await RegistrarUser({
        nombre: "Nuevo Usuario",
        correo: "nuevo@example.com",
        contraseña: "123456",
        id_rol: 2,
        telefono: "9999-0000",
      });
      console.log("REGISTRO OK =>", res.status, res.data);
      alert("Registro OK (revisa consola)");
    } catch (err) {
      console.error("REGISTRO ERR =>", err?.response?.data || err);
      alert(err?.response?.data?.message || "Error registro");
    }
  };

  return (
    <div style={{ padding: 20 }}>
      <h2>Test Auth</h2>
      <div style={{ display: "grid", gap: 8, maxWidth: 360 }}>
        <input
          type="email"
          placeholder="correo"
          value={correo}
          onChange={(e) => setCorreo(e.target.value)}
        />
        <input
          type="password"
          placeholder="contraseña"
          value={contrasena}
          onChange={(e) => setContrasena(e.target.value)}
        />
        <button onClick={probarLogin}>Probar Login</button>
        <button onClick={probarRegistro}>Probar Registro</button>
      </div>
    </div>
  );
}
